import React from "react";
import { Icon } from "leaflet";

let RL = false;
let Map = false;
let TileLayer = false;
let Marker = false;
let Popup = false;
if (process.env.BROWSER) {
  RL = require("react-leaflet");
  Map = RL.Map;
  TileLayer = RL.TileLayer;
  Marker = RL.Marker;
  Popup = RL.Popup;
}

function MapIp({ cordinates }) {
  const position = [cordinates?.lat, cordinates?.lng];

  return (
    <div className="">
      {process.env.BROWSER && (
        <Map
          style={{ width: "100%", height: "500px" }}
          center={position}
          zoom={13}
        >
          <TileLayer
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
          />
          <Marker position={position} icon="">
            <Popup>
              A pretty CSS3 popup.
              <br />
              Easily customizable.
            </Popup>
          </Marker>
        </Map>
      )}
    </div>
  );
}

export default MapIp;
